INSERT INTO `of_ad` (`id`,`title`,`content`,`type`,`display_position`,`img`,`url`,`order_key`,`state`,`create_time`) VALUES ('1','雷格斯上海中心大厦开业迎宾','<p>
	是专业的服务式办公室及联合办公空间租赁平台
</p>
<p>
	<span style=\"color:#222222;font-family:Menlo, monospace;font-size:11px;white-space:pre-wrap;background-color:#FFFFFF;\">展示全国主要城市的办公室地点等详尽信息</span>
</p>','index','首页-轮播图','/uploads/image/20180731/fe2db00b5017b61f36c490a031d3a5f4.jpg','http://www.officebc.com/news/098.html','1','1','1532968636');
INSERT INTO `of_ad` (`id`,`title`,`content`,`type`,`display_position`,`img`,`url`,`order_key`,`state`,`create_time`) VALUES ('2','OfficeBC 最新优惠，惊喜多多！','<span style=\"color:#2B2B2B;font-family:simsun, arial, helvetica, clean, sans-serif;font-size:14px;text-align:justify;text-indent:28px;white-space:normal;background-color:#FFFFFF;\">群众办事曾遭遇的“门难进、脸难看、话难听、事难办”在党</span>','index','首页-轮播图','/uploads/image/20180731/524f142f5a2d724767c792936c3f124d.jpg','http://www.officebc.com/news/','1','1','1532968681');
INSERT INTO `of_ad` (`id`,`title`,`content`,`type`,`display_position`,`img`,`url`,`order_key`,`state`,`create_time`) VALUES ('3','关于 OfficeBC','OfficeBC是专业的服务式办公室及联合办公空间租赁平台，展示全国主要城市的办公室地点等详尽信息，免费为您提供租赁咨询、地点推荐、协助签约等相关服务，协助您找到最满意的办公场所，并获得租金折扣等优惠条件。','index','首页-中图文','/uploads/image/20180731/189fa4713c09d1d2bdc21a198456ec03.jpg','','1','1','1532968741');
INSERT INTO `of_ad` (`id`,`title`,`content`,`type`,`display_position`,`img`,`url`,`order_key`,`state`,`create_time`) VALUES ('4','关于商务中心/服务式办公室','商务中心提供精装修的独立办公室，配置成套的办公家具及通讯设施，提供公用的会议室、前台、茶水间、会客室等共享空间，有专人提供企业必须的相关服务，大幅提高您的商务效率。服务式办公室在面积及租期等方面有高度灵活性，十分适合小型团队或短租客户使用，并且多设立在中央商务区的高档写字楼内，有利于提升您的企业形象。','index','首页-中图文','/uploads/image/20180731/68252c17e04716d492f2dc1273a20734.jpg','','1','1','1532968800');
INSERT INTO `of_ad` (`id`,`title`,`content`,`type`,`display_position`,`img`,`url`,`order_key`,`state`,`create_time`) VALUES ('32','关于联合办公','联合办公是近年起源于美国硅谷的共享办公模式，来自不同公司、项目或行业的人员，可以在在特别设计和安排的办公空间中共同工作、共享办公环境，办公者可与其他团队分享信息、知识、技能、想法和拓宽社交圈子等。<br />','index','首页-中图文','/uploads/image/20180830/1781592446ed1c21ab1fcc9758bea524.jpg','','1','1','1535594128');
